const initState = {
    projects: [
      {id:'0', title:"raspberrypi0", content:"Sensor Placed at Level 3 Office"},
      {id:'1', title:"raspberrypi1", content:"shalara"}
    ],
    data: []
  }

  const chartReducer = (state = initState, action) => {
    switch (action.type) {
      case 'FETCH_APDATA':
        console.log(action.myAP)
        return {
          ...state,
          myAP: action.myAP,
        }
      case 'FETCH_APERROR':
        return state;
      default: 
        return state;
    }

  }

  export default chartReducer;
